import React from 'react';

export default function Home() {
  return (
    <div className="flex flex-col items-center justify-center px-6 py-20 bg-gray-50 min-h-screen">
      <img src="/images/hahu-logo.png" alt="HahuTech Logo" className="w-48 md:w-64 mb-8" />
      <h1 className="text-4xl md:text-5xl font-bold text-blue-700 mb-4 text-center">Welcome to HahuTech Solutions</h1>
      <p className="text-lg md:text-xl text-gray-700 text-center max-w-2xl">
        We specialize in innovative Data Engineering, Business Intelligence, and AI-driven solutions for global clients.
      </p>
      <a href="/about" className="mt-8 inline-block bg-blue-700 text-white px-6 py-3 rounded-md text-lg hover:bg-blue-800 transition">
        Learn More
      </a>
    </div>
  );
}
